import React, { useState } from "react";
import { View, Text, TextInput, Touchable, TouchableOpacity, StyleSheet, Button } from "react-native";
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import styles from "../../../estiloGeral";

export default function Carrinho({ navigation }) {
    return (
        <View style={styles.container}>
            <View style={estilo.main}>

            </View>
            <View style={estilo.secon}>
                <Button title="enviar" style={[estilo.botoes, {width:'50%'}]}></Button>
                <Button title="finalizar" style={[estilo.botoes, {width:'50%'}]}></Button>
            </View>
        </View>
    )
}
const estilo = StyleSheet.create({
    main: {
        flex: 5,
        backgroundColor: '#2c2c2c'
    },
    secon: {
        flex: 1,
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'space-between',
    },
    botoes:{
        // width:'50%',
    }

})
